import React from 'react';
class  AdmitCard extends React.Component {
    state = {
        User_id: [],
        UserStatus: []
    }
    render() {
        
        return (
            <>
            <h1>Admit Card</h1>
            </>
        )
    }
}


export default AdmitCard;
